import React from 'react'
import ResultStats from './ResultStats'

const Admin = () => {
  const result = [
    {
        name : "Akhil",
        email: "akhil.2024",
        Total_Marks: 10,
        Time: [4000,2000,3100],
    },
    {
        name : "Akhil2",
        email: "akhil.2024",
        Total_Marks: 13,
        Time: [4000,2000,3100],
    },
    {
        name : "Akhil3",
        email: "akhil.2024",
        Total_Marks: 2,
        Time: [4000,2000,3100],
    }
  ]
  return (
    <div className='Leaderboard'>
        <h2>Leaderboard</h2>
        {result.map((data)=>{

        return (<ResultStats data = {data}/>)
        })}
    </div>
  )
}

export default Admin
